(17,1,"2019-02-25 21:44:35","2019-02-25 21:44:35","<!-- wp:heading -->\n<h2><strong>Renata Heusser Jungman</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>Vorstandspräsidentin&nbsp;</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Punkt 3</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Etiam porta sem malesuada magna mollis euismod. Vestibulum id ligula porta felis euismod semper.</p><cite>Heinrich L.</cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Als Gründungsmitglied bin ich seit 2012 für unsere Vereinigung aktiv. Ich bin Mama von zwei Söhnen. Mein älterer Sohn Romeo lebt mit dem Dravet Syndrom. Er und die Hoffnung auf eine Heilung dieser seltenen Krankheit sind die treibende Kraft für mein Engagement.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[\"25\",\"24\",\"26\"],\"columns\":2,\"align\":\"center\",\"className\":\"aligncenter\"} -->\n<ul class=\"wp-block-gallery aligncenter columns-2 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"https://dravet.development/wp-content/uploads/2019/02/csm_Andrea_Dietrich_Bildquelle_Nadja_Tempest_c37958c102.jpg\" alt=\"\" data-id=\"25\" data-link=\"https://dravet.development/?attachment_id=25\" class=\"wp-image-25\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://dravet.development/wp-content/uploads/2019/02/banner_shop-657.jpg\" alt=\"\" data-id=\"24\" data-link=\"https://dravet.development/?attachment_id=24\" class=\"wp-image-24\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://dravet.development/wp-content/uploads/2019/02/DSC_1409-1024x684.jpg\" alt=\"\" data-id=\"26\" data-link=\"https://dravet.development/?attachment_id=26\" class=\"wp-image-26\"/></figure></li></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:columns {\"columns\":3} -->\n<div class=\"wp-block-columns has-3-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:para